const userdata=[
                {id:1, name:'kumar1', email:'kumar1@gmail.com'},
                {id:2, name:'kumar2', email:'kumar2@gmail.com'}
               ]


class AxoisHttpCalls extends Component {

    constructor()
    {
        super();
        this.state={ 
                    users:[]
         }
    }


    handleApiData=()=>
    {
        this.setState({  users: userdata })
    }
    
    render() {
        return (<>

                <div className="container py-5">
                    <h3 className="py-3"> AXIOS RESTAPI CALLS.....</h3>

                    {
                        users.map( (res,index)=>{
                            return(<tr>
                                            <td>{res.id}</td>
                                            <td>{res.id}</td>
                                            <td>{res.id}</td>
                                            
                                    </tr>)
                        })
                    }
                    
                        <br /><br /><br />
                        <button onClick={this.handleApiData}>Click</button>


                </div>

        </>)
    }

}

export default AxoisHttpCalls



